import React from 'react';
import styles from './Footer.module.css';  // Assuming the styles for Footer are here

const Footer = ({ isDarkMode }) => {
    return (
        <footer className={isDarkMode ? styles.dark_footer : styles.light_footer}>
            {/* Footer content */}
        </footer>
    );
};

export default Footer;
